export const Item = () => {
    const items = [
        {
            img: '../../img/img1.png',
            title: 'Tourism',
            content: 'One of Saturn’s largest rings may be newer than anyone',
            bottom: 'June 6, 2019    By Rickie Baroch'
        },
        {
            img: '../../img/img1.png',
            title: 'Tourism',
            content: 'One of Saturn’s largest rings may be newer than anyone',
            bottom: 'June 6, 2019    By Rickie Baroch'
        },
        {
            img: '../../img/img1.png',
            title: 'Tourism',
            content: 'One of Saturn’s largest rings may be newer than anyone',
            bottom: 'June 6, 2019    By Rickie Baroch'
        },
        {
            img: '../../img/img1.png',
            title: 'Tourism',
            content: 'One of Saturn’s largest rings may be newer than anyone',
            bottom: 'June 6, 2019    By Rickie Baroch'
        }
    ]
    const result = () => {
        const haha = items.map(function(value){
            return (
                <div>
                    <div className="img-div">
                        <img src={value.img} alt="" />
                    </div>
                    <span>{value.content}</span>
                </div>
            )
        })
        return haha;
    }

}
